import React from 'react';
import {Input} from 'reactstrap';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <div>
        <Input className='link'
          bsSize="lg"
        />
      </div>
      </header>
    </div>
  );
}

export default App;
